measurements.description:
One well-held velvety flower and one bud on one 33-cm upright unstaked inflorescence;

	sepals red-orange;
	petals lanceolate, red-orange, darker distal tips;
	pouch yellow, exterior heavily overlaid red-orange, darker venation, undulate front margin;
	staminode yellow blushed red-orange; 

	substance firm; texture crystalline.
